description.text:
This is my take on the belt buckle worn by the mage Hannah in the awesome comic &quot;Rat Queens.&quot;  
<a rel="nofollow" href="https://en.wikipedia.org/wiki/Rat_Queens" >https://en.wikipedia.org/wiki/Rat_Queens</a>  
This one is sized for about a 2&quot; belt. It prints on edge for maximum strength and is oriented along the Y axis. So to resize, scale identically on the Z and Y axes and then adjust the X for thickness.
